import './App.css';
import ListBarang from './ListBarang';
import Cart from './Cart';
import { Router } from 'react-router-dom'
import { BarangProvider } from './BarangContext';

function App() {
  return (
    <BarangProvider>
    <div className="App">
      <Router>
        <ListBarang />
        <Cart />
      </Router>
    </div>
    </BarangProvider>
  );
}

export default App;
